        \                           <b><font size=\"5\"><span style='font-size: 16.0pt'>PRIVACY
        NOTICE RELATING TO DEVELOPMENT\r\n                                APPLICATIONS</span></font></b></p>\r\n
        \                       <p>\r\n                            Logan City Council,
        by resolution has authorised the disclosure of Integrated Development\r\n
        \                           Assessment System information via Planning and
        Development Online (PD Online), located\r\n                            on
        Council's website.</p>\r\n                        <p>\r\n                            The
        disclosure of this information is in accordance with the exceptions provided\r\n
        \                           for under Information Privacy Principle 11(1)(a)
        and 11(1)(d) contained in the Information\r\n                            Privacy
        Act 2009 and section 723(1)(a) of the Sustainable Planning Act 2009.\r\n                        </p>\r\n
        \                       <p>\r\n                            Logan City Council
        will take reasonable steps to ensure that your personal information\r\n                            is
        handled in a way that does not contravene the Information Privacy Act 2009,
        however\r\n                            please be aware that all development
        application and approval documentation, including\r\n                            all
        submissions made against any development application lodged with Logan City\r\n
        \                           Council, may be published on PD Online, located
        on Council's website.\r\n                        </p>\r\n                        <p>\r\n
        \                           <b><font size=\"5\"><span style='font-size: 12.0pt'>Purpose</span></font></b></p>\r\n
        \                       <p>\r\n                            The Planning and
        Development Online system is intended to allow interested individuals\r\n
        \                           to have convenient, informal access to planning
        documents and the status of development\r\n                            applications.</p>\r\n
        \                       <p>\r\n                            Planning and Development
        Online is not intended to be used, and must not be used,\r\n                            for
        formal purposes such as for the purposes of property transactions or settlements.\r\n
        \                           Access to documents and information for formal
        purposes must be obtained through\r\n                            Council's
        formal document search procedures, not through Planning and Development\r\n
        \                           Online.</p>\r\n                        <p>\r\n
        \                           <b><font size=\"5\"><span style='font-size: 12.0pt'>Copyright</span></font></b></p>\r\n
        \                       <p>\r\n                            The information
        and documents available for access through the Planning and Development\r\n
        \                           Online system are copyright works under the Copyright
        Act 1968 (Cth).</p>\r\n                        <p>\r\n                            Documents
        and information are made available through Planning and Development Online\r\n
        \                           for informal use by individuals. Users are not
        entitled to, and must not, reproduce,\r\n                            publish,
        communicate or adapt the documents or information made available using\r\n
        \                           the system.</p>\r\n                        <p>\r\n
        \                           Without limiting the above, commercial use, sale
        or re-transmission of documents\r\n                            or information
        obtained using Planning and Development Online is prohibited. Enquiries\r\n
        \                           about commercial use of such documents and information
        should be directed to Council's\r\n                            Development
        Assessment Branch (telephone (07) 3412 5269).\r\n                        </p>\r\n
        \                       <p>\r\n                            <b><font size=\"5\"><span
        style='font-size: 12.0pt'>No liability</span></font></b></p>\r\n                        <p>\r\n
        \                           The documents and information available using
        Planning and Development Online are\r\n                            intended
        for informal use only. Council makes no representation or warranty about\r\n
        \                           their accuracy, completeness, suitability or fitness.</p>\r\n
        \                       <p>\r\n                            The documents and
        information available for access through Planning and Development\r\n                            Online
        should not be relied upon without confirmation from another source such as\r\n
        \                           Council's Development Assessment Branch (telephone
        (07) 3412 5269).</p>\r\n                        <p>\r\n                            Some
        types of documents (for example, plans and drawings) may not be available
        through\r\n                            Planning and Development Online, even
        if they form part of a development application\r\n                            which
        is otherwise available.</p>\r\n                        <p>\r\n                            Except
        for liability which cannot legally be excluded, Council excludes all liability\r\n
        \                           (including liability for negligence) arising from
        use of documents or information\r\n                            available through
        the Planning and Development Online system. Liability which cannot\r\n                            legally
        be excluded is hereby limited to the maximum extent possible.</p>\r\n                        <p>\r\n
        \                           <b><font size=\"5\"><span style='font-size: 12.0pt'>Right
        to grant or refuse access</span></font></b></p>\r\n                        <p>\r\n
        \                           Access to the Planning and Development Online
        system is at the discretion of Council.\r\n                            Council
        reserves the right to refuse to allow access to any part of the Planning\r\n
        \                           and Development Online system without prior notice,
        and without the need to give\r\n                            any reason for
        doing so.</p>\r\n                        <p>\r\n                            <b><font
        size=\"5\"><span style='font-size: 12.0pt'>Information privacy</span></font></b></p>\r\n
        \                       <p>\r\n                            The Planning and
        Development Online system may record some information about each\r\n                            access
        to the system (for example, the lP address of the computer from which the\r\n
        \                           system is accessed, the date and time of access,
        and the pages, documents or information\r\n                            viewed).
        This information is used for statistical and site development purposes.</p>\r\n
        \                       <p>\r\n                            Except for information
        specifically provided by users, Council does not collect\r\n                            any
        other personal information during use of the Planning and Development Online\r\n
        \                           system. Any personal information specifically
        provided will not be disclosed to\r\n                            third parties
        except with consent, or where required by law.</p>\r\n                        <p>\r\n
        \                           Council takes steps to maintain the currency and
        accuracy of the personal information\r\n                            it holds.
        If you require access to any personal information about you that may held\r\n
        \                           by Council, or if you have any other questions
        about information privacy, email\r\n                            the Council
        at <font color=\"blue\"><a href=\"mailto:council@logan.qld.gov.au\">council@logan.qld.gov.au\r\n
        \                           </a></font>or call the Council on (07) 3412 3412.</p>\r\n
        \                       <p>\r\n                            <b><font size=\"5\"><span
        style='font-size: 12.0pt'>Laws</span></font></b></p>\r\n                        <p>\r\n
